import * as React from 'react';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Modal from '@mui/material/Modal';
function Modals (Data) {
    console.log(Data)
    const [open, setOpen] = React.useState(false);
    const handleOpen = () => setOpen(true);
    const handleClose = () => setOpen(false);
    const style = {
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)',
        width: 400,
        bgcolor: 'background.paper',
        border: '2px solid #000',
        boxShadow: 24,
        p: 4,
      };
    return(
        <>
            <div>
                <Button onClick={handleOpen}  variant="contained"><span className='check'>></span>Continuar</Button>
                <Dialog
        maxWidth="md"
        open={opent}
        onClose={bitacoraClose}
      >
        <DialogTitle
          sx={{
            p: 3
          }}
        >
          <Typography variant="h4" gutterBottom>
            <label>BITACORA OPORTUNIDAD No.</label><b>{opor.oport.id}</b>
          </Typography>
        </DialogTitle>
            <form>
              <DialogContent>
              <Grid item xs={12} md={12}>
              <tbody>
                <TableCell>{t('#')}</TableCell>
                <TableCell>{t('Usuario')}</TableCell>
                <TableCell>{t('Fecha')}</TableCell>
                <TableCell>{t('Comentario')}</TableCell>
                {bita.map(data => {
                return (
                <TableRow key={data}>
                   <TableCell>{data.solinume}</TableCell>
                   <TableCell>{data.usuaalia}</TableCell>
                   <TableCell>{data.sobifech}</TableCell>
                   <div dangerouslySetInnerHTML={{__html: data.sobitext}} className='container'/>
                 </TableRow>
                 )})}   
              </tbody>
              </Grid>
                <Grid item xs={11} style={{margin:'0 auto'}}>
                  <EditorText setHtml={setHtml}/>
                </Grid>
                <Grid item xs={11} style={{margin:'0 auto'}}>
                <Select id="otherusers" multiple>              
                {ComerInge.map((option) => (
                    <option value={option.alias}>{option.name}</option>
                ))}      
                </Select>
                <Autocomplete
                    item
                    multiple
                    limitTags={2}
                    getOptionLabel={(option) => option.name}
                    options={ComerInge}
                    renderOption={(props, option) => (
                      <li {...props}>
                        <Avatar
                          sx={{
                            mr: 3
                          }}
                          src={option.avatar}
                        />
                        {option.name}
                      </li>
                    )}
                    renderInput={(params) => (
                    <TextField
                      style={{fontZise:'50px'}}
                        {...params}
                        variant="outlined"
                        fullWidth
                        InputLabelProps={{
                          shrink: true
                        }}
                        placeholder={t('NOTIFICAR USUARIOS...')}
                      />
                    )}
                    renderTags={(members, getTagProps) =>
                      members.map((ev, index) => (
                        <Chip
                          id='sa'
                          value='1'
                          key={ev.name}
                          label={ev.name}
                          {...getTagProps({ index })}
                          avatar={<Avatar src={ev.avatar} />}
                        />
                      ))
                    }
                />
                </Grid>
                <Grid item xs={10} style={{margin:'0 auto'}}>
                  <TextField
                    fullWidth
                    label={t('Asunto')}
                    name="asunto"
                    variant="outlined"
                  />
                </Grid>
              </DialogContent>
              <DialogActions
                sx={{
                  p: 3
                }}
              >
                <Button  onClick={bitacoraClose} style={{
                    background:'#ba000d',
                    color:'#fff'
                  }}>Cancelar<ClearIcon className='ico'/></Button>
                <Button variant="contained"  onClick={()=>saveBita(opor.oport.id)}>Guardar<SaveIcon className='ico'/></Button>
              </DialogActions>
            </form>
      </Dialog>
        </div>
        </>
    )
}
export default Modals;
